import './contact.css';



const contact =()=>{
    return(
    <>
        <section className="contactfirst-sec">
            <div className="container">
                <div className="row">
                    <div className="col-lg-6 col-md-6 col-sm-6"></div>

                </div> 
            </div>        
        </section>
       


    </>
)
}
export default contact;
